import React from 'react'
import '../CSS/main.css'

function CountWithAutoObservabel({store}) {
    return (
        <>
        <div  class = "example">
            <div>
                hello.
                {store.count}

            </div>
        </div>
        </>
    )
}

export default CountWithAutoObservabel;
